,33,159,'159',NULL,NULL,NULL,NULL,NULL,''),(36,26,34,NULL,'1974',NULL,NULL,1974.01010000000000000000,1974.12312359590000000000,NULL,''),(37,27,34,200,'200',NULL,NULL,NULL,NULL,NULL,''),(38,22,35,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(39,23,36,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(40,26,37,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(41,27,37,200,'200',NULL,NULL,NULL,NULL,NULL,''),(42,22,38,NULL,'(para Décio Pignatari)<br />\nAntonio Risério Filho<br /><br />\nRECONSTRAIR AS HERAS PANSADAS NO SEIO DO FUNDO OS ÍNOS VÍ-<br />\nVIDOS ADORLESCENTES DESDESTRUIR AS FALIDAS PRENSUDAS NO<br />\nBLANCO DAS FALHAS DEXTRAIR REÍZES DA HORTA CRIVADA ESCRA-<br />\nVAR ATÉ A ÚLTÍMÃ PATA DE VORAGEM TEXPOR OS VÍNTIMOS DILA-<br />\nCERRAMENTOS EM MAGALHAS FRAGMINTOS EXPLOVISÕES TECER O LA-<br />\nBARENTO DE SÚDITAS VAIAS DISESPARO CONTINDO-SE NO ESPÚRO<br />\nDA SELA O SAL TRILHANDO NOS TALHADOS DAS CAXAS DESABSTRUIR<br />\nOS ALHOS ROUVIDOS BOCO RANIZ APARAR O TETO SOBRETRAIR AS<br />\nESTRALAS ENTRANHAS DA ABÓBORA SILENTE PRAZER A LUZ DESVA-<br />\nLANDO PELAS ESFARPAS EXCETAR O LÍNXRIO FLERA FELUZ VENTRE-<br />\nLAÇANDO-ME FULMAR OS CÃES RESVELANDO DUROS DENTES DE MÁR-<br />\nMORE REVOLTER MÔNICA A DOS ESPELHOS MÓVEIS MULTIESPALHOS<br />\n(AZUL É A CÔR DOS TEUS CABELOS LOUROS) DOMANDO A PELE AN-<br />\nGORÁ VIA E AÇOITE NO MEU LEITO QUE FARFALA MANTAR NO AZAL<br />\nOS GALOS DO AZUR CAMPAR UM MUSAICO DE FRESTAS E FARRAPOS<br />\nCOM A RASGARGANTA ÁBRIA DO DESCONEXIDO',NULL,NULL,NULL,NULL,NULL,''),(43,23,39,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(44,26,40,NULL,'1974',NULL,NULL,1974.01010000000000000000,1974.12312359590000000000,NULL,''),(45,27,40,200,'200',NULL,NULL,NULL,NULL,NULL,''),(46,22,41,NULL,'ganhar a _____ perder a _____<br /><br />\nperder a _____ ganhar a _____<br /><br />\nperder o _____ ganhar o _____<br /><br />\nganhar o _____ perder o _____<br /><br />\nganhar a _____ perder o _____<br /><br />\nperder o _____ ganhar o _____<br /><br />\nperder a _____ ganhar o _____<br /><br />\nganhar o _____ perder a _____',NULL,NULL,NULL,NULL,NULL,''),(47,23,42,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(48,24,43,159,'159',NULL,NULL,NULL,NULL,NULL,''),(49,26,44,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(50,27,44,200,'200',NULL,NULL,NULL,NULL,NULL,''),(51,22,45,NULL,'HAROLDO DE CAMPOS<br />\n-',NULL,NULL,NULL,NULL,NULL,''),(52,23,46,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(53,24,47,159,'159',NULL,NULL,NULL,NULL,NULL,''),(54,69,48,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(55,70,49,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(56,33,50,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(57,26,51,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(58,27,51,200,'200',NULL,NULL,NULL,NULL,NULL,''),(59,22,52,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(60,23,53,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(61,26,54,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(62,27,54,200,'200',NULL,NULL,NULL,NULL,NULL,''),(63,22,55,NULL,'H. de Campos: O Lance de Dados de Mallarmé será talvez o manual de astronáutica do ano 2.000. Astrológon ton Hómeron ‚— Homero era astrógogo, dizia Heráciito, o Obscuro (com uma ponta de ironia)...<br /><br />\nP: Eugen Gomringer disse que a poesia concreta está \"genético-historicamente\" morta. Mal conheço os poemas de Gomringer. Os que li, enquadram-se na \"fase ortodoxa\" da poesia concreta. Estará Gomringer dizendo o óbvio, i. é, que\" a \"fase ortodoxa\" ficou pra trás? E, se assim for, não estará, também, incorrendo no equívoco generalizado de considerar a poesia concreta um \"ismo\"? Enfim, como você entende a frase?<br /><br />\nH. de Campos: Gomringer, como os pintores da Escola de Zurique, sempre foi um artista preciso, porém limitado. Sua importância vem de sua precisão, pelo menos numa primeira fase da poesia concreta. Os concretos brasileiros, barrocos por vocação, ao contrário, sempre tenderam para uma obra plúrima e diversificada, jamais se contiveram, a não ser taticamente, nos lindes de uma ortodoxia. O concreto, aliás, é umponto de vista globalizante (sincrônico) sobre a literatura, não um \"ismo\" a mais. Outra coisa é observar que a poesia concreta, pela sua radicalidade de propostas e problemas, sequer começou a ser decodificada entre nós, quanto mais assimilada... \" Des contemporains ne savent pas lire\" (Mallarmé). Ouver.<br /><br />\nP: Décio Pignatari, numa entrevista, disse que previa, para os próximos cinquenta anos, \"um certo cessar das transformações. E um longo período de redundâncias mais ou menos aceitas e que formarão a linguagem comum universal do fim do século...\" ‚— brincar de profeta é um barato. Você topa?<br /><br />\nH. de Campos: O Lance de Dados de Mallarmé será talvez o manual de astronáutica do ano 2.000. Astrológon ton Hómeron ‚— Homero era astrólogo, dizia Heráclito, o Obscuro (com uma ponta de ironia)...',NULL,NULL,NULL,NULL,NULL,''),(64,23,56,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(65,24,57,159,'159',NULL,NULL,NULL,NULL,NULL,''),(66,24,58,159,'159',NULL,NULL,NULL,NULL,NULL,''),(67,69,59,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(68,70,60,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(69,33,61,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(70,26,62,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(71,27,62,200,'200',NULL,NULL,NULL,NULL,NULL,''),(72,22,63,NULL,'P: Moacy Cirne escreveu, há algum tempo, que a diferença entre a poesia concreta e o poema-processo estava no fato de a poesia concreta subordinar tudo à estrutura, enquanto o poema-processo subordinaria ao processo. Reconhecendo que esta distinção é claramente insustentável, gostaria de saber qual a tua visão do poema-processo.<br /><br />\nH. de Campos: O poema-processo é a doença infantil da poesia concreta.<br /><br />\nP: Você acabou de escrever um livro sobre o Macunaíma de Mário de Andrade. A primeira opção feita pelas novas gerações diante da literatura brasileira é entre Mário e Oswald de Andrade. Por Oswald se chega à poesia concreta, à guerrilha artística. Quando você escreveu o livro sobre Mário, tinha essas coisas em mente? Eu gostaria que você falasse sobre isso porque eu li sua dedicatória pra Caetano no Morfologia do Macunaíma.<br /><br />\nH. de Campos: Na dedicatória ao Caetano está: \"como Oswald devora Mário\". Acho que deixei tudo muito claro no capítulo inicial do meu Morfologia, \"Marcação do Percurso\": é preciso re-ver Mário de Andrade, na sua face radical ‚– vale dizer, o Macunaíma, deixando de lado os \"enxames de sentimentos inarticulados\" com que certa crítica procura idealizar os aspectos mais amenos e menos interessantes de sua personalidade e de sua obra. Para esta re-visão em modo devorativo, foi necessário percorrer a via Oswald. Acho que o MIRAMAR, MACUNAÍMA e SERAFIM formam uma trilogia escrita por dois autores, que se confraternizam não apenas pelo acidente dos sobrenomes, mas<br /><br />\nno nível objetivo desses textos fundamentais. \"Mário escreveu a nossa Odisseia e criou<br /><br />\nduma tacapada o herói cíclico e por cinquenta anos o idioma poético nacional\" (Oswald<br /><br />\nre MACUNAÍMA, Revista de Antropofagia, 1928).<br /><br />\nP: Ultimamente, você está mais voltado para a crítica e a teoria da literatura. Onde<br /><br />\nandam as Galáxias? Tem feito novos poemas?<br /><br />\nH. de Campos: Ultimamente tenho publicado mais crítica e teoria por razões editoriais<br /><br />\nóbvias (já que a poesia entre nós continua \"gratuita e clandestina\", ‚— pelo menos aquela<br /><br />\ncujo teor de informação é demasiado',NULL,NULL,NULL,NULL,NULL,''),(73,23,64,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(74,24,65,159,'159',NULL,NULL,NULL,NULL,NULL,''),(75,26,66,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(76,27,66,200,'200',NULL,NULL,NULL,NULL,NULL,''),(77,22,67,NULL,'para as redundâncias medianeiras do consumo). Depois, os suplementos ou páginas literárias que andam por aí não me animam, muito pelo contrário... Mas a PERSPECTIVA, que lentamente vai começando a abrir-se também para a criação ‚— falo de minha coleção SIGNOS, que, espero, deslanche um pouco em 74, ‚– já programou uma antologia de textos meus, XADREZ DE ESTRELAS. Um \"percurso textual\", desde o AUTO DO POSSESSO, de 1950, até os poemas inéditos da série LACUNAE. O livro encerra com uma seleção (um \"trailer\" em forma de pré-antologia) das GALÁXIAS, nas quais continuo a trabalhar. As GALÁXIAS acabaram confundindo-se um pouco (ou muito) com minha vida e viagens, viraram um bio-texto em périplo (como pensava talvez o Mário Faustino, do seu Livro que ficou em fragmentos; só que esse amigo inesquecível, raro artesão, ainda estava vinculado a uma ideia reguladora de \"verso\"). Eu trabalho diretamente por \"epifanias\", por \"blocos\" de fragmentos-eventos, que se dispersam e se auto-pontuam: concreções (daí a relação dessa \"prosa\" com as técnicas da \"poesia concreta\"). Meu canteiro de trabalho ainda está aberto: in progress. Não sei quando terminarei as GALÁXIAS. Não estou hipnotizado nem por uma data nem por um número. Prossigo (pro-e-con-sequente, espero).<br />\nP: Décio Pignatari pintou com um novo saque, fantástico, na minha opinião: \"batismo &amp; retomada\" do surpreendente método que Paul Valéry extraiu de Leonardo da Vinci: o método heurístico-semiótico. Como você vê o panorama da crítica atual e, dentro dele, o método Valéry ‚— da Vinci ‚— Peirce ‚— Pignatari?<br />\nH. de Campos: Vou falar de outra coisa, talvez falando do mesmo (desde Pound, para nós, o método da crítica é heurístico: ideogrâmico, analógico). Resumi, há pouco, numa das minhas aulas, numa equação de complementaridades, o que me parece a situação problemática da crítica literária, hoje, sob o influxo da linguística (sémiologie saussuriana) e da semiótica (peirciana): Saussure está para Peirce como a teoria dos anagramas (que derroga a arbitrariedade do signo e a linearidade do significante, no campo da poesia) está para a teoria dos diagramas (a linguagem como um ‚"ícone de relações\"). E ainda, se quisermos convocar uma outra contribuição fundamental à poética para o mesmo âmbito de convergências: E como para ambos estão Fenollosa/Pound com a sua teoria do ideograma (método por excelência da poesia).<br /><br />\nHAROLDO DE CAMPOS<br />\nem entrevista a Antonio Riserio Filho<br />\n-',NULL,NULL,NULL,NULL,NULL,''),(78,23,68,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(79,24,69,159,'159',NULL,NULL,NULL,NULL,NULL,''),(80,22,70,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(81,33,71,NULL,'42',NULL,NULL,NULL,NULL,NULL,''),(82,69,72,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(83,70,73,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(84,33,74,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(85,69,75,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(86,70,76,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(87,33,77,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(88,69,78,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(89,70,79,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(90,33,80,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(91,69,81,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(92,70,82,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(93,33,83,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(94,69,84,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(95,70,85,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(96,33,86,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(100,69,90,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(101,70,91,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(102,33,92,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(103,69,93,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(104,70,94,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(105,33,95,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(106,69,96,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(107,70,97,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(108,33,98,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(109,69,99,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(110,70,100,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(111,33,101,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(112,69,102,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(113,70,103,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(114,33,104,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(115,69,105,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(116,70,106,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(117,