loridos poetaremos)<br />\nsegue quase literalmente<br />\na klangfarbenmelodie (somcormelodia ou melodiadetimbres)<br />\nda parte inicial do quarteto<br />\ncomposto em 1930<br />\n1¬™ audição em 13-4-31<br />\nque eu, nascido nesse ano,<br />\nouvi entre 52-53',NULL,NULL,NULL,NULL,NULL,''),(442,23,416,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(443,24,417,159,'159',NULL,NULL,NULL,NULL,NULL,''),(444,22,418,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(445,33,419,NULL,'38',NULL,NULL,NULL,NULL,NULL,''),(446,22,420,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(447,33,421,NULL,'18',NULL,NULL,NULL,NULL,NULL,''),(448,22,422,NULL,'José Lino Grunewald',NULL,NULL,NULL,NULL,NULL,''),(449,33,423,NULL,'50',NULL,NULL,NULL,NULL,NULL,''),(450,22,424,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(451,33,425,NULL,'62',NULL,NULL,NULL,NULL,NULL,''),(452,22,426,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(453,33,427,NULL,'30',NULL,NULL,NULL,NULL,NULL,''),(454,22,428,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(455,33,429,NULL,'38',NULL,NULL,NULL,NULL,NULL,''),(456,22,430,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(457,33,431,NULL,'70',NULL,NULL,NULL,NULL,NULL,''),(458,22,432,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(459,33,433,NULL,'56',NULL,NULL,NULL,NULL,NULL,''),(460,22,434,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(461,33,435,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(462,26,436,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(463,27,436,200,'200',NULL,NULL,NULL,NULL,NULL,''),(464,22,437,NULL,'‚"trop de musique! trop de musique!‚"<br />\n(webern, 1903)<br /><br />\n‚"foi<br />\nsomente em 1952<br />\napós sucessivas audições,<br />\nem janeiro e fevereiro,<br />\ndo quarteto opus 22 de anton webern<br />\nque o gelo se quebrou.<br />\ndesde esse momento,<br />\nigor não teve sossego-<br />\naté que estivesse familiarizado-<br />\ncom a obra pouco prolixa-<br />\nmas rica de invenção-<br />\ndo jovem discípulo de schoenberg,-<br />\nmorto tragicamente em 15 de outubro de 1945.‚"<br />\n(robert siohan, stravinski, pág. 141)<br /><br />\nquarteto opus 22 p/ violino, clarineta, sax tenor e piano<br /><br />\n(fig.)<br />\nviol.<br />\nclarineta<br />\nsax tenor<br />\npiano<br /><br /><br />\n‚"sim, o quarteto é um milagre.<br />\no que me espantou acima de tudo<br />\nfoi a sua originalidade.<br />\nnão é exagero dizer que<br />\ntodo o universo da composição musical<br />\njamais teve qualquer coisa<br />\nque se aproximasse<br />\ndessa originalidade 100%.‚"<br />\n(alban berg, carta de 19-8-32 a webern)<br /><br />\n‚"lygia finger‚"<br />\n(da minha série de poemas coloridos poetaremos)<br />\nsegue quase literalmente<br />\na klangfarbenmelodie (somcormelodia ou melodiadetimbres)<br />\nda parte inicial do quarteto<br />\ncomposto em 1930<br />\n1¬™ audição em 13-4-31<br />\nque eu, nascido nesse ano,<br />\nouvi entre 52-53',NULL,NULL,NULL,NULL,NULL,''),(465,23,438,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(466,24,439,159,'159',NULL,NULL,NULL,NULL,NULL,''),(467,26,440,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(468,27,440,200,'200',NULL,NULL,NULL,NULL,NULL,''),(469,22,441,NULL,'na gravação de leibowitz<br />\nna mesma época em que ouvia<br />\no \"roteiro de um boêmio\"<br />\n(álbum com 4 discos em 78 rotações<br />\nfase pré-LP)<br />\nde lupicínio rodrigues<br />\nagora é quase impossível ouví-los:<br />\ndo-quarteto,-em 20 anos,<br />\nsó houve duas gravações<br />\na de leibowitz e a de craft<br />\n(ambas esgotadas)<br />\ne ninguém reeditou o roteiro de lupicínio<br /><br />\nna voz mansa de lupi<br />\num expressionismo contido<br />\nquase falado<br />\nisomórfico<br />\num<br />\nso<br />\nlu<br />\nço<br />\ncortou sua voz<br />\nnão lhe deixou fa<br />\nlar<br />\ntendo ouvido-<br />\num mínimo de webern-<br />\ncaetano entendeu tudo-<br />\ne fundindo o impossível-<br />\nwebernizou lupicínio<br />\nou lupicinou webern<br />\nna maravilhosa mise-en-musique<br />\nou releitura poético-musical<br />\nque fez<br />\nde \"dias dias dias\"<br />\ndo-poetamenos<br />\nraio x entre mentes<br /><br />\nentrementes-<br />\njoão<br />\nchegou<br /><br />\n\"basta comparar os sons do sax-tenor de stan<br />\ncom o som vocal de joão para notar o paralelo.<br />\no ar se move sem esforço pela palheta, em um caso,<br />\ne pelas cordas vocais, no outro. é como se o ar<br />\nnão fosse impelido mais do que o suficiente para fluir.<br />\ntal aproximação pessoal exige que o instrumentista possua<br />\nsegurança soberba e controle absoluto de seu instrumento.<br />\nstan e joão não cometem enganos nesse ponto.\" (gene lees)<br /><br />\nsó que joão é mais cool do que o cool.-<br />\nstan getz, perto dele, é barroco.<br /><br />\nwebern deu à música erudita',NULL,NULL,NULL,NULL,NULL,''),(470,23,442,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(471,24,443,159,'159',NULL,NULL,NULL,NULL,NULL,''),(504,22,476,NULL,'<br />\nhector olea<br />\nLUZAZUL<br />\nlo que sin evidencia la palabra muda<br />\nALGO TINTACTOTACTO<br />\nMERETRISTE CASTANA<br />\nCABELLEZA TRENZADA<br />\nCAIDA HASTA LOS HOMBRES<br />\nPROSTITODA LA LUZ DE UNA TRISTAZA<br />\nSOMBRAHEMBRA AGUA<br />\nlo que tras del espejo la realidad cuelga',NULL,NULL,NULL,NULL,NULL,''),(505,22,477,NULL,'<br />\n‚— Cansa-se. Signor, da vida dos signos,<br />\nembora não haja outra.<br />\nO Místico Quente, Sutra II, 5-a<br /><br />\n‚— A criou a palavra elefante e todos os elefantes começaram a desaparecer, desde a espécie que cheira com as orelhas até a que trepa em posição ginecológica. A encerebrou a essência dos elefantes e no lugar deles começaram a aparecer outros objetos.<br />\n‚— Que objetos?<br />\n‚— Cadeiras.<br />\n‚— Palavras cadeiras?<br />\n‚— Ambas.<br /><br />\n‚— A criou a palavra amor e todos os amores começaram a desaparecer, desde o que se degusta rindo com a nova forma nasi até o que se pirlipica com o gomo meio aberto. A encerebrou a essência dos amores e em seu lugar começaram a aparecer outras coisas.<br />\n‚— Que coisas?<br />\n‚— A emoção indireta e as máquinas de pipoca plástica.<br /><br />\n‚— A criou a palavra pássaro e todos os pássaros começaram a desaparecer, desde os que mudam de plumagem durante o voo até os que as mulheres fazem de terceiro seio. A encerebrou a essência dos pássaros e no lugar deles começaram a aparecer outros pássaros.<br />\n‚— Outros?<br />\n‚— Sim: os que não voam apenas pelo céu.<br /><br />\n‚— A criou e<br /><br />\nsp março 75',NULL,NULL,NULL,NULL,NULL,''),(506,22,478,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(507,22,479,NULL,'<br />\nQue o homem use a pele do leão e a mulher o pelo do carneiro.<br />\nAquele que deseja mas não age, produz pestilência.<br />\nNenhum pássaro voa alto demais, se voa com as próprias asas.<br />\nO rugir dos leões, o uivar dos lobos, a fúria da tempestade no mar, e a espada<br />\ndestruidora são porções de eternidade demasiado grandes para o olho do homem.<br />\nA abelha trabalha: não tem tempo para mágoas.<br />\nA eternidade está enamorada das obras do tempo.<br />\nA macieira nunca pergunta à faia como haverá de crescer; nem o<br />\nleão ao cavalo como apanhará sua presa.<br />\nAquele cuja face não luz nunca será uma estrela.<br />\nErguem-se prisões com as pedras da lei, bordéis com os tijolos da religião.<br />\nNo tempo de semear, aprende; na colheita, ensina; no inverno, goza.<br />\nA raposa culpa a armadilha, não a si mesma.<br />\nO rato, o calunga, a raposa, o coelho, espreitam raízes; o leão, o tigre, o cavalo, o<br />\nelefante, espreitam frutos.<br />\nA vergonha é a capa do orgulho.<br />\nOs tigres da ira são mais sábios que os cavalos da instrução.<br />\nO pássaro ‚– ninho, a aranha ‚– teia, o homem ‚– amizade.<br />\nA cabeça, Sublime; o coração, Pathos; os genitais, Beleza; pés &amp; mãos, Proporção.<br />\nO verme ferido perdoa o arado.<br />\nPreces não lavram! Louvores não ceifam!<br />\nSe outros não fossem tolos, nós seríamos.<br />\nA pompa do pavão é a glória de Deus.<br />\nA lascívia do bode é a bondade de Deus.<br />\nA ira do leão é a sabedoria de Deus.<br />\nA nudez da mulher é a obra de Deus.<br />\nTristeza em excesso, ri. Alegria em excesso, chora.<br />\nOs olhos do fogo, as narinas do ar, a boca da água, a barba da terra.',NULL,NULL,NULL,NULL,NULL,''),(508,22,480,NULL,'<br />\nó<br />\ncoroada ióplok (fig.) antílope<br />\nde violetas<br /><br />\nsorriso-mel agna (fig.) alga<br /><br />\nsagrada mellikhomeide (fig.) melicanora<br /><br />\nSafo Sappho (fig.) gal<br /><br />\n(fig.)<br /><br />\nharoldo de campos<br />\n28 set 74',NULL,NULL,NULL,NULL,NULL,''),(509,22,481,NULL,'nota:-<br /><br />\ntradução de duas linhas<br />\ndo trovador provençal<br />\nbernart de ventadorn<br />\ncitadas por ezra pound (canto XX)<br />\nsegundo um método entrevisto<br />\npor décio pignatari<br />\ncomo sempre<br />\n‚"il miglior fabbro‚"<br />\naugusto de campos<br /><br /><br />\nsi no\'us vei domna don plus mi cal,negus vezer mon bel pensar no val-<br />\nse eu não vejo a mulher que eu mais desejo nada que eu veja vale o que eu não vejo',NULL,NULL,NULL,NULL,NULL,''),(510,22,482,NULL,'décio pignatari<br />\nbelfos-valdevinos junho-agosto<br />\n1974',NULL,NULL,NULL,NULL,NULL,''),(511,22,483,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(512,22,484,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(513,22,485,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(514,22,486,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(515,22,487,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(516,22,488,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(517,22,489,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(518,22,490,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(519,22,491,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(520,22,492,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(521,22,493,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(522,22,494,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(523,22,495,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(524,22,496,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(525,22,497,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(526,22,498,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(527,22,499,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(528,22,500,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(529,22,501,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(530,22,502,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(531,22,503,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(532,22,504,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(533,22,505,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(534,22,506,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(535,22,507,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(536,22,508,NULL,'<br />\na dimensão física da música popular.<br />\no difícil no fácil.<br />\nnon multa sed multum.<br />\nbagatelas.<br />\ninfrasegundos de superinformação.<br />\nsabedoria que se perdeu cornos pósteros<br />\nesses chatos maravilhosos<br />\nde stockhausen a cage.<br /><br />\n\"pela primeira vez em sua história<br />\na música se tornou tão despojada e transparente<br />\nque os seus elementos individuais pareciam flutuar<br />\nisolados<br />\nentre apavorantes bolsas de ar de silêncio total\" (krenek)<br /><br />\n‚"you see, when i was a kid i used to save up for a month,-<br />\nso i could get an r-&amp;-b álbum and, the same day, the complete works-<br />\nof anton webern. maybe that means something. maybe that tells you-<br />\nsomething about my music.\" (frank zappa ‚– anos 60)<br /><br />\n(fig.)<br />\numa melodia contínua<br />\ndeslocada de um instrumento para outro mudando constantemente sua cor<br /><br />\nem 37 anos de vida criativa (1908-1945)<br />\n31 obras<br />\nduração média: 5 minutos<br />\na mais longa: 10 minutos<br />\na mais curta: menos de um minuto<br />\na obra de anton webern<br />\ncabe toda em 4 LPs:<br />\ncerca de 3 horas.<br /><br />\njoão gilberto: 7 LPs (piazzolla tem 40)<br /><br />\ntoda a obra de webern-<br />\npoderia ser executada<br />\nnum único concerto<br />\nmas tanta compressão informativa<br />\nseria ainda hoje<br />\numa bomba-sônica para a maioria dos ouvintes<br />\nmegatons de informação sonora<br />\nmegantons<br /><br />\n\"porque eu nao sou um cão…‚"<br />\n(webern, 1912 ‚— já tinha feito as 6 peças para grande orquestra<br />\nopus 6, pré-melodiadetimbres)<br /><br />\n\"ao piano ele fazia com que as maravilhas matemáticas-<br />\ndesaparecessem: em seu lugar ele tornava aparentes-<br />\napenas as puras relações de som\" (robert craft)<br /><br />\n\"eu não sei como vou chegar até o fim do mês\" (carta de 26-9-26)<br /><br />\n\"ernst krenek disse que quando webern conduzia uma sinfonia de haydn-<br />\nele a fazia soar de tal modo que a gente sentia que a tinha escutado-<br />\npela primeira vez. webern parece ter sido um maestro extremamente-<br />\nsensível, fanaticamente rigoroso, mas paciente. seu horror físico-<br />\ndo ruído fazia-o relutante até de começar a ensaiar, sabendo de antemão<br />\nque o volume, a grossura, a má entonação, a expressão falsa e a<br />\narticulação errada seriam uma tortura.‚" (robert craft)',NULL,NULL,NULL,NULL,NULL,''),(537,22,509,NULL,'<br />\n‚"no momento não tenho um único aluno‚" (webern, carta de 20-4-38)<br /><br />\njoão gilberto emprega pelo menos uns 5 AA ‚—<br />\nme disse tuzé ‚—<br />\ncada um é um som diferente<br /><br />\n‚"no momento só tenho um aluno‚" (webern, carta de 29-4-38)<br /><br />\n‚"ansermet diz que ter visto e ouvido webern tocar-uma única nota<br />\nao piano era observar um homem em ato de devoção\" (robert craft)<br /><br />\n\"se ao menos eu pudesse ser entendido um pouco!‚" (webern, carta de 20-10-39).<br /><br />\n\"pouco impressionado<br />\nante a audição de daphnis et chloe (de ravel) disse webern<br />\na ansermet (único comentário):<br />\npor que ele usa<br />\nquatro<br />\nde cada instrumento de sopro?<br />\nbeethoven usou apenas dois<br />\ne é tão forte (es ist so gross).‚" (robert craft)<br /><br />\n\"não lhe parece que a primeira reação das pessoas-<br />\ndiante desta partitura (variações para orquestra opus 30) será:<br />\n‚"bem, não há nada dentro dela\"? (carta a willi reich, 3-5-41)<br /><br />\n\"viver é defender uma forma\" (hoelderlin citado por webern)<br /><br />\n\"se ao menos tomassem algum conhecimento da minha obra\" (carta de 3-3-41)<br /><br />\n\"não queremos repetir, deve haver sempre algo novo.‚" (webern)<br /><br />\n\"uma importante afirmação de schoenberg: compressão sempre significa-<br />\nextensão\" (webern)<br /><br />\nwebern o incomunicativo comunicativo: nenhuma obscuridade. formas-<br />\nclaras e precisas. partituras limpas, límpidas.<br /><br />\n\"entendo a palavra arte como significando a faculdade de apresentar-<br />\num pensamento na forma a mais clara e a mais simples, isto é,-<br />\nna forma a mais compreensível!\" (carta de 6-8-28)',NULL,NULL,NULL,NULL,NULL,''),(538,22,510,NULL,'<br />\n\"webern é ao mesmo tempo o mais simples<br />\ne o mais difícil dos compositores:<br />\no mais e o menos intelectual,<br />\no mais fácil de selecionar e, ainda assim,<br />\no mais difícil de seguir,<br />\no mais esotérico e o mais compreensível,<br />\no mais clássico e no entanto o mais avançado,<br />\no mais individual e pessoal, sendo ainda o mais<br />\ninfluente e o mais amplamente imitado.<br />\na simplicidade da estética de webern<br />\né que explica todos esses paradoxos ‚—<br />\na música de webern consiste<br />\nem poucas notas arranjadas<br />\nnum período de tempo extremamente curto\"<br />\n(eric salzman).<br /><br />\n\"trabalho até 1 hora numa peça pouco agradável<br />\nfria e úmida<br />\nalgo assim como uma caverna nos dias de calor.<br />\ndepois do almoço repouso no campo atrás da casa,<br />\numa hora no máximo.<br />\nalgumas vezes banho com minna e as crianças.<br />\ntrabalho até a hora do chá,<br />\nàs vezes até mais tarde.<br />\ndepois das 6 horas, ordinariamente,<br />\npasseio no krumpengraben ou nos bosques vizinhos<br />\na procura de cogumelos e amoras.\"<br />\n(diário de webern, 1927)<br /><br />\n\"eu gostava de procurar cogumelos e de vez em quando meu caminho<br />\nse cruzava com o de webern...<br />\n... o mestre admirava o conteúdo de minha cesta repleta, em que<br />\nhavia alguns raros e interessantes cogumelos…<br />\n… ficávamos contemplando as notáveis qualidades dos fungos…‚"<br />\n(cesar bresgen,-os úítimos dias de webern em mittersill)<br /><br />\nwebern e cage?<br />\ncogumelos<br />\nsilêncios<br /><br />\ncage fez o silêncio falar em-4\'33\"<br />\nwebern faz ouvir<br />\no silêncio em suas músicas.-<br /><br />\nfeçhado-aberto, o futuro da música: webern in cage.<br /><br />\n\"considerem quanta moderação é necessária<br />\npara que alguém se exprima com tanta brevidade.<br />\npode-se expandir todos os olhares num poema,<br />\ntodos os suspiros num romance.<br />\nmas exprimir um romance num simples gesto,<br />\numa alegria num suspiro ‚—<br />\numa tal concentração só pode estar presente<br />\nem proporção a uma ausência de autopiedade.‚"<br />\n(schoenberg sobre as bagatelas)',NULL,NULL,NULL,NULL,NULL,''),(539,22,511,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(540,22,512,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(541,22,513,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(542,22,514,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(543,22,515,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(544,22,516,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(545,22,517,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(546,22,518,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(547,22,519,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(548,22,520,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(549,22,521,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(550,22,522,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(551,26,523,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(552,27,523,200,'200',NULL,NULL,NULL,NULL,NULL,''),(553,22,524,NULL,'<br />\nwebern foi morto por engano<br />\npor um soldado americano<br />\ndas tropas acantonadas na áustria.<br />\num soldado nervoso no gatilho.<br />\nquando saía à porta da casa de benno mattl,-<br />\nseu genro, em mittersill, para fumar um charuto<br />\n(o primeiro, depois de longos anos)<br />\nque benno contrabandeara com os americanos.<br />\neles andavam atrás de benno<br />\ne lhe prepararam uma cilada.<br />\nforam à casa dele vender a \"moamba\" (cigarros,-<br />\ndólares, etc) para fazer o flagrante.<br />\nenquanto dão voz de prisão a mattl numa sala,-<br />\nwebern sai do quarto dos netos para fumar ao ar-<br />\nlivre.<br />\npõe a mão no bolso e o americano atira<br />\n(depois, naturalmente, se safaria alegando<br />\n\"legítima defesa‚").<br /><br />\n\"sons de sino<br />\nno ar claro da montanha<br />\nsão evocados em quase todas as obras de webern\" (r. craft).<br /><br />\nsina e sino<br /><br />\no assassino se chamava raymond n. bell (isto é, sino)-<br />\ne era cozinheiro da 42¬™ divisão<br />\napelidada divisão arco-íris.<br />\no soldado sino morreu a 3 de setembro de 1955-<br />\nsem saber quantos séculos de música tinha matado-<br />\ncom um só tiro<br />\nwith a bang<br />\nnot with a whimper<br /><br />\nagora ‚"bolchevismo cultural‚" é o nome dado a tudo o que se refira<br />\na schoenberg, berg e a mim (assim como a krenek)…<br />\n… eu não sei o que hitler entende por música nova<br />\nmas sei que o que nós designamos por esse termo-<br />\né um crime para essa gente.‚" (aw, 1933)<br /><br />\n\"eu queria partir, partir! para as montanhas onde tudo é claro, a-<br />\nágua, a terra, o ar!\" (carta a alban berg, 21-6-1912).<br /><br />\ndepoimento da viúva sino:-<br />\n\"ele nasceu<br />\nem 16 de agosto de 1914,-<br />\nprofissão: mestre-cuca<br />\nde restaurante<br />\nmorreu de alcoolismo.<br />\nsei poucas coisas sobre o tal acidente.<br />\nquando ele voltou pra casa, depois da guerra,-<br />\ndisse que tinha matado um homem<br />\nno cumprimento do dever.<br />\ncada vez que ele ficava bêbado, dizia:-',NULL,NULL,NULL,NULL,NULL,''),(554,23,525,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(555,26,526,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(556,27,526,200,'200',NULL,NULL,NULL,NULL,NULL,''),(557,23,527,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(558,26,528,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''